import Head from "next/head";
import Navbar from "../components/navbar";

const Layout = (props) => (
<div>
<Head>
<title>BitzPrice</title>
</Head>
<Navbar />
<div>
{props.children}
</div>


<style jsx>{`
body{
    background: lightblue;
}

`}</style>
</div>

)

export default Layout;
